pragma solidity ^0.8.0;
import "./usersStore.sol";

contract StudentContract {
        address public usersStoreAddress;

    struct Course {
        string courseCode;
        string courseName;
        uint maxGrade;
        uint studentGrade;
    }

    struct Semester {
        uint id;
        mapping(string => Course) courses;
        string[] courseCodes;
    }

    struct Student {
        uint universityID;
        string name;
        string program;
        uint submissionYear;
        address publicAddress;
        string email;
        mapping(uint => Semester) semesters;
    }

    struct SimpleStudent {
        uint universityID;
        string name;
        string program;
        uint submissionYear;
        string email;
        address publicAddress;
    }
     constructor(address _usersStoreAddress) public {
        usersStoreAddress = _usersStoreAddress;
    }


    mapping(uint => Student) public students;
    uint[] public studentIDs;

    function addStudent(
        uint _universityID,
        string memory _name,
        string memory _program,
        uint _submissionYear,
        string memory _email,
        address _publicAddress
    ) public {
        Student storage student = students[_universityID];
        student.universityID = _universityID;
        student.name = _name;
        student.program = _program;
        student.submissionYear = _submissionYear;
        student.publicAddress = _publicAddress;
        studentIDs.push(_universityID);
UsersStore usersStore = UsersStore(usersStoreAddress);
        usersStore.addUser(_publicAddress, _name, _email, "Student");
    }

    function addSemester(uint _universityID, uint _semesterID) public {
        Semester storage semester = students[_universityID].semesters[_semesterID];
        semester.id = _semesterID;
    }

    function addCourse(
        uint _universityID,
        uint _semesterID,
        string memory _courseCode,
        string memory _courseName,
        uint _maxGrade
    ) public {
        Semester storage semester = students[_universityID].semesters[_semesterID];
        semester.courses[_courseCode] = Course(
            _courseCode,
            _courseName,
            _maxGrade,
            0
        );
        semester.courseCodes.push(_courseCode);
    }

    function getStudentInfo(uint _universityID)
        public
        view
        returns (
            uint universityID,
            string memory name,
            string memory program,
            uint submissionYear,
            address        )
    {
        Student storage student = students[_universityID];
        return (
            student.universityID,
            student.name,
            student.program,
            student.submissionYear,
            student.publicAddress
        );
    }

    function getStudentCourses(uint _universityID, uint _semesterID)
        public
        view
        returns (Course[] memory)
    {
        Semester storage semester = students[_universityID].semesters[_semesterID];

        // Create an array to store the courses
        Course[] memory courses = new Course[](semester.courseCodes.length);

        // Add the courses to the array
        for (uint i = 0; i < semester.courseCodes.length; i++) {
            courses[i] = semester.courses[semester.courseCodes[i]];
        }

        return courses;
    }

    function getStudents() public view returns (SimpleStudent[] memory) {
        // Create an array to store the students
        SimpleStudent[] memory allStudents = new SimpleStudent[](studentIDs.length);

        // Add the students to the array
        for (uint i = 0; i < studentIDs.length; i++) {
            Student storage student = students[studentIDs[i]];
            allStudents[i] = SimpleStudent(
                student.universityID,
                student.name,
                student.program,
                student.submissionYear,
                student.email,
                student.publicAddress
            );
        }

        return allStudents;
    }
}
